import React from "react";

// props不可以被修改
export default class MyNav extends React.Component{
    render(){
        return(
            <div>
                {/* 接收app定义的内容 eg:这里注释要有一个大括号里面/*解析为jsx注释 */}
                 <h2>{this.props.title}</h2>
                <ul>
                   {
                       this.props.nav.map((element,index) =>{
                           //map=遍历，组件的复用
                           return <li key="index"> {element} </li>
                           // 不写key会警告，不写也可以出结果
                       })
                   }
                </ul>
            </div>
        )
    }
}
